PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "law_offices" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "office_name" varchar, "representative_lawyer_name" varchar, "postal_code" varchar, "address" varchar, "latitude" float, "longitude" float, "phone_number" varchar, "business_hours" varchar, "office_url" text, "focus" varchar);
CREATE TABLE IF NOT EXISTS "users" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "user_name" varchar);
CREATE TABLE IF NOT EXISTS "favorites" ("id" integer NOT NULL PRIMARY KEY, "user_id" integer NOT NULL, "law_office_id" integer NOT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, CONSTRAINT "fk_rails_83103be628"
FOREIGN KEY ("law_office_id")
  REFERENCES "law_offices" ("id")
, CONSTRAINT "fk_rails_d15744e438"
FOREIGN KEY ("user_id")
  REFERENCES "users" ("id")
);
CREATE TABLE IF NOT EXISTS "reviews" ("id" integer NOT NULL PRIMARY KEY, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "review" text DEFAULT NULL, "user_id" integer DEFAULT NULL, "law_office_id" integer DEFAULT NULL, "star" float DEFAULT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE INDEX "index_favorites_on_user_id" ON "favorites" ("user_id");
CREATE INDEX "index_favorites_on_law_office_id" ON "favorites" ("law_office_id");
CREATE UNIQUE INDEX "index_favorites_on_user_id_and_law_office_id" ON "favorites" ("user_id", "law_office_id");
COMMIT;
